import React, { useState,useEffect } from 'react'
import services from '../../services/services';
import DummyQuestionList from './DummyQuestionList';
import Form from '../form/Form';

function DummyQuestionApi() {
   const [question,setQuestion]=useState([])
    var categoryId = JSON.parse(localStorage.getItem("categoryId"));
    console.log(categoryId);
    useEffect(() => {
        getQuestionlist();
    }, [1])

    const getQuestionlist = async () => {
        const data={
            categoryId:categoryId
        }
        console.log(data)
        const options = {
            method: 'POST',
            headers: {
                "Apiuserid": "49507884",
                "Scope": "In.QuizApp.READ",   

            }
        }
        var result = await services.getQuestionlist(data,options)
        setQuestion(result.data.data)
    };

    return (
        <div>
            {
                <DummyQuestionList questionlist={question}  />

            }

        </div>
    )
}

export default DummyQuestionApi
